import { Card, CardContent, Toolbar, Typography } from "@mui/material";


const Header = () => {
    return (
        <>
            <Toolbar>
                <Card>
                    <CardContent>
                        <Typography>
                            Simple Omelette Recipe
                        </Typography>
                    </CardContent>
                </Card>
            </Toolbar>
        </>
    );
};

export default Header;
